import { getToken } from "../../../shared/TokenProvider.ts";


async function ChangeWish(id, present, price, reservUser, reservUserName, userId, userName)
{
  const Url="https://localhost:7003//Wish/update/wish";
  const token= await getToken();
  let response = await fetch(Url,
  {
    method: "GET",
    headers:     
    {
      'Accept': 'application/json',
      'Authorization': "Bearer " + token,
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({
        "id": id,
        "present": present,
        "price": price,
        "reservUser": reservUser,
        "reservUserName": reservUserName,
        
      })
  });

  try
  {
    const j = await response.json();
    return j;
  }
  catch
    {
        window.location.replace("http://localhost:3000/eror")
        return
    }
}

export default ChangeWish
